import ReactDOM from 'react-dom/client';
import AppRouter from './AppRouter';

import './App.css';

export default function App() {
  return (
    <div className="App">
      <h1> Hearthstone Arena Deck Builder App</h1>
      <AppRouter />
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
